import {
  Stack,
  Modal,
  ModalOverlay,
  ModalContent,
  ModalHeader,
  ModalCloseButton,
  ModalBody,
  FormLabel,
  FormControl,
  Center,
  Spinner,
} from "@chakra-ui/react";
import React, { useEffect, useState } from "react";
import { memo } from "react";

import { tournament } from "../../../types/api/tournament";
import { Participant } from "../../../types/api/Participant";

type Props = {
  userId: number | undefined;
  isOpen: boolean;
  onClose: () => void;
  usersR1: String[];
  usersR2: Array<Participant>;
  clases: Array<Participant>;
  selectedReTournament: tournament | null;
};

export const ResultDetailModal = memo((props: Props) => {
  const { isOpen, onClose, usersR1, usersR2, clases } = props;

  const [loading, setLoading] = useState(true);
  const [className1, className2] = clases;

  useEffect(() => {
    setLoading(false);
    console.log("usersR1:", usersR1); // usersR1をコンソールに出力
  }, [usersR1, usersR2]);

  const usersR1Data = usersR1.map(item => {
    const parts = item.split(': '); // コロンで分割
    const ranking = parts[0]; // ランキング
    const name = parts[1]; // 参加者の名前
    return { ranking, name };
  });



  return (
    <Modal
      isOpen={isOpen}
      onClose={onClose}
      autoFocus={false}
      motionPreset="slideInBottom"
    >
      <ModalOverlay />
      <ModalContent pb={2}>
        <ModalHeader>予想</ModalHeader>
        <ModalCloseButton />
        <ModalBody mx={4}>
          {loading ? (
            <Center h="100vh">
              <Spinner />
            </Center>
          ) : usersR1.length === 0 && usersR2.length === 0 ? (
            <div>誰も予想していません。</div>
          ) : (
            <Stack spacing={4}>
              {usersR1.length !== 0 && (
                <>
                  <FormControl>
                    {className1 && className1.className && (
                      <FormLabel>{String(className1.className)}</FormLabel>
                    )}
                    <FormLabel>1位</FormLabel>
                    <Stack>
                    <FormLabel>{usersR1[0].participantName}</FormLabel>
                    </Stack>
                  </FormControl>
                  <FormControl>
                    <FormLabel>2位</FormLabel>

                  </FormControl>
                  <FormControl>
                    <FormLabel>3位</FormLabel>

                  </FormControl>
                </>
              )}
              {usersR2.length !== 0 && (
                <>
                  <FormControl>
                    {className2 && className2.className && (
                      <FormLabel>{String(className2.className)}</FormLabel>
                    )}
                    <FormLabel>1位</FormLabel>

                  </FormControl>
                  <FormControl>
                    <FormLabel>2位</FormLabel>

                  </FormControl>
                  <FormControl>
                    <FormLabel>3位</FormLabel>

                  </FormControl>
                </>
              )}
            </Stack>
          )}
        </ModalBody>
      </ModalContent>
    </Modal>
  );
});
